import React from "react";

const App = () => {
  const fruits = [
    { name: "apple" , calories:95},
    { name: "banana",calories:100},
    { name: "strawberry",calories:25 },
    { name: "orange",calories:240 },
    { name: "grape",calories:78},
  ];
  const item = fruits.map((fruit) => <li key={fruit.name}>{fruit.name}</li>);
  return (
    <>
      <ol>{item}</ol>

    </>
  );
};

export default App;
